Instruction.String:
if (Coding.Strategy == 1)
{
// not needed when called in blocking mode:	Coding.Strategy = 0;
	Coding.Programmer.IndepReadWriteList[0].UpdateCode();	
}
else if (Coding.Strategy == 2)
{
// not needed when called in blocking mode:	Coding.Strategy = 0;
	Coding.Programmer.ReadB4WriteList[0].UpdateCode();
}
// not needed when called in blocking mode:
//else if (Coding.Strategy == 0)
//{
//	Coding.Strategy = 1;
//}

int effort = 0;
while(Coding.ChangedCode.Count > 0)
{
	CodeArtifact ca = Coding.ChangedCode.Dequeue();
	Coding.CodeVersionDict[ca] = ca.Version;
	effort++;
}
Coding.SyncCount++;
Coding.SyncEffort += effort;

// create artifact
NewCA = Coding.Programmer.CodeRepo.Create("CodeArtifact") as CodeArtifact;
Coding.WorkingOn = NewCA;
Simulation.CodeRepoContext.CodeArtifactContext.ChangeData cd = NewCA.Create("ChangeData") as Simulation.CodeRepoContext.CodeArtifactContext.ChangeData;
cd.Coder = Coding;
cd.Extend = 1.0;
cd.UpdateOnVersion = 0;
Coding.WorkingOnUpdate = cd;


// add to known artifacts
Coding.CodeVersionDict.Add(NewCA, 1);

Coding.WorkingOn = null;
double rand = Random.Uniform();
if (rand <= Coding.CreateP)
	choice = 1;
else if (rand <= Coding.CreateP+Coding.UpdateP)
	choice = 2;
else if (rand <= Coding.CreateP+Coding.UpdateP+Coding.ReadP)
	choice = 3;
else 
	choice = 0;

if (isConflict)
{
	Coding.ConflictCount++;
}
else
{
	if (Coding.WorkingOnUpdate == null)
	{
		DomainProAnalyst.Instance.Report("ReadFeedback encountered NullReference in Collaborator: "+Coding.Programmer.ComponentId);
	}
	else
	{
		Coding.CodeVersionDict[Coding.WorkingOnUpdate.CodeArtifact] = Coding.WorkingOnUpdate.UpdateOnVersion++;
	}
}
if (Coding.UpdateCount > 0)
	Coding.CorrectionRatio = System.Convert.ToDouble(Coding.ConflictCount)/System.Convert.ToDouble(Coding.UpdateCount);

// add new artifacts to the Coding role
// get Link from Summary
// check if CodeArtifact is already in Dictionary

while(Observing.Inbox.Count > 0)
{
	ChangeSummary cs = Observing.Inbox.Dequeue();
	CodeArtifact ca = cs.SumChangedArtifactRef;
	Dictionary<CodeArtifact, int> dict = Observing.Programmer.CodingList[0].CodeVersionDict;
	if (!dict.ContainsKey(ca))
	{
		// strategy 1: load the latest version
		dict.Add(ca, 0);
		Observing.Programmer.CodingList[0].ChangedCode.Enqueue(ca);		
	}
	else
	{
		// check if local version is older than updated version 
		// (not the case when own update)
		int localVersion = dict[ca];
		if (localVersion < ca.Version && 
			!Observing.Programmer.CodingList[0].ChangedCode.Contains(ca))
		{
			Observing.Programmer.CodingList[0].ChangedCode.Enqueue(ca);
		}
	}
}

Observing.isIdle = true;

// select Artifact to update
// determine where to get version Nr from
// determine update extend/scope
// determine update duration

var Coding = IndepReadWrite.Programmer.CodingList[0];

if (Coding.CodeVersionDict.Count == 0)
{
	IndepReadWrite.emptyDict++;
	// Work around: call CreateCode --> no longer as this creates an additional thread
	//Coding.CreateCode();
}
else
{
CodeArtifact ca = Coding.WorkingOn;
if (ca == null)
{	
	int pos = (int)Random.Uint(0, (uint)Coding.CodeVersionDict.Count);
//Console.WriteLine("Start Updating Artifact at Dictionary Pos: "+pos+" out of //"+Coding.CodeVersionDict.Count);
	//int pos = System.Convert.ToInt32(Math.Floor(Random.Uniform() * System.Convert.ToDouble(Coding.CodeVersionDict.Count)));

	List<CodeArtifact> list = new List<CodeArtifact>(Coding.CodeVersionDict.Keys);
	ca = list[pos];
	Coding.WorkingOn = ca;
	//if (ca == null)
	//	Console.WriteLine("... but no Artifact at pos: "+pos );
}
else
{ // repeating a conflicting update
	// update the code for the local dictionary = READ Operation
	Coding.SyncCount++;
	Coding.SyncEffort++;
	Coding.CodeVersionDict[ca] = ca.Version;

}

Simulation.CodeRepoContext.CodeArtifactContext.ChangeData cd = ca.Create("ChangeData") as Simulation.CodeRepoContext.CodeArtifactContext.ChangeData;
cd.Coder = Coding;
cd.Extend = 1.0;
cd.UpdateOnVersion = Coding.CodeVersionDict[ca];

Coding.WorkingOnUpdate = cd;
Coding.UpdateCount++;

// not needed when called in blocking mode: Coding.ProxyUpdateCode();
}

// select Artifact to update
// determine where to get version Nr from
// determine update extend/scope
// determine update duration

var Coding = ReadB4Write.Programmer.CodingList[0];

if (Coding.CodeVersionDict.Count == 0)
{
	// Work around: call CreateCode
	;//Coding.CreateCode();
}
else
{
CodeArtifact ca = Coding.WorkingOn;
if (ca == null)
{
	// READ NEW CODE
	Coding.ReadCode();

	int pos = System.Convert.ToInt32(Math.Floor(Random.Uniform() * System.Convert.ToDouble(Coding.CodeVersionDict.Count)));

	List<CodeArtifact> list = new List<CodeArtifact>(Coding.CodeVersionDict.Keys);
	ca = list[pos];
	Coding.WorkingOn = ca;
}
else
{ // repeating a conflicting update
	// update the code for the local dictionary = READ Operation
	Coding.SyncCount++;
	Coding.SyncEffort++;
	Coding.CodeVersionDict[ca] = ca.Version;

}

Simulation.CodeRepoContext.CodeArtifactContext.ChangeData cd = ca.Create("ChangeData") as Simulation.CodeRepoContext.CodeArtifactContext.ChangeData;
cd.Coder = Coding;
cd.Extend = 1.0;
cd.UpdateOnVersion = Coding.CodeVersionDict[ca];

//Coding.CodeVersionDict[ca] = cd.UpdateOnVersion++;
//Now  Done after being sure that the update was successful

Coding.UpdateCount++;

Coding.ProxyUpdateCode();
}

while (PubSub.Inbox.Count > 0)
{
	ArtifactChange ac = PubSub.Inbox.Dequeue();
	newCS = PubSub.EmailNfy.CodeRepo.Create("ChangeSummary") as ChangeSummary;

// as long as links cannot really represent cardinality use one summery per event

	SumChangedArtifactRef scRef = PubSub.EmailNfy.CodeRepo.Create("SumChangedArtifactRef") as SumChangedArtifactRef;	
	scRef.CodeArtifact = ac.ChangedArtifactRef;
	newCS.SumChangedArtifactRefLink = scRef;

}

PubSub.isIdle = true;

// add to inbox of every observer

foreach(Programmer coder in ChangeSummary.CodeRepo.ProgrammerList)
{
	foreach(ProgrammerContext.Observing obs in coder.ObservingList)
	{
		obs.Inbox.Enqueue(ChangeSummary);
		obs.TriggerRead();
	}
}

ConflictDetection.UpdateSuccess++;
if (ConflictDetection.CheckingUpdate != null)
{
	newAC = ConflictDetection.AccessConn.CodeRepo.Create("ArtifactChange") as ArtifactChange;

	ChangedArtifactRef caRef = ConflictDetection.AccessConn.CodeRepo.Create("ChangedArtifactRef") as ChangedArtifactRef;	
	caRef.CodeArtifact = ConflictDetection.CheckingUpdate.CodeArtifact;
	newAC.ChangedArtifactRefLink = caRef;	
}

// retrieve from changed code
// check if changed data is available, if so, 
// if no conflict, create change notification event
// Read calls Create directly

isConflictFree = false;
ConflictDetection.CheckingUpdate = null;

if (ConflictDetection.ChangedCode.Count > 0)
{
	CodeArtifact ca =	ConflictDetection.ChangedCode.Dequeue();
	while ((ca.ChangeDataList == null || ca.ChangeDataList.Count == 0)&& ConflictDetection.ChangedCode.Count > 0)
	{
		ca = ConflictDetection.ChangedCode.Dequeue();
	}

	Simulation.CodeRepoContext.CodeArtifactContext.ChangeData cd = ca.ChangeDataList[0];	
		// each change results in the CA to be placed in the ChangedCode queue, 
		// so we only observe the first CD list item, and remove it after processing.

	if (cd.UpdateOnVersion == ca.Version && ca.Version == 0) 
	{			
		// new Code
		isConflictFree = true;
		ca.Version++;
	}	
	else
	{	
		if (cd.UpdateOnVersion < ca.Version) 
		{			
			ca.NrConflicts++;
		}
		else
		{
			isConflictFree = true;
			ca.Version++;
			// set the Link to the changedData object that contains the right update, 
			// other updates afterwards are bound to fail
			// set the link in any case, as both success and failure cases need it
		}		
		ca.ChangeDataList.RemoveAt(0);		
	}
	ConflictDetection.CheckingUpdate = cd;
}
else
{
	ConflictDetection.isIdle = true;
}

foreach (CodeRepo cr in CodeRepoList)
{;
	int i = 0;
	foreach(Programmer p in cr.ProgrammerList)
	{
		p.ComponentId = "Programmer#"+i;
		i++;
	}
}
